import React from 'react';
import styled from 'styled-components';

const Styles = styled.div`
    width: 300px;
`;

class Home extends React.Component {
    constructor(props) {
        super(props);
        document.title = "Home";
    }

    render() {
        return (
            <Styles>
                <h1>Hello</h1>
            </Styles>
        );
    }
}

export default Home;
